import React from 'react'

const MapGoogle = () => {
  return (
    <iframe src="https://maps.google.com/maps?width=700&amp;height=440&amp;hl=en&amp;q=Samarqand%20viloyat%20yoshlar%20texnoparki+(Title)&amp;ie=UTF8&amp;t=&amp;z=15&amp;iwloc=B&amp;output=embed" frameBorder="0" scrolling="no" marginHeight="0" marginWidth="0"></iframe>
  )
}

export default MapGoogle
